import React from 'react';

export default function Home() {
  return (
    <div className="home-body">
      <img className="image" src="../../public/lucifer.jpg" alt="lucifer" />
      <div className='text'>
        Home
      </div>
      <div className="logo">
        <img src="../../public/logo.svg" alt="" />
      </div>
    </div>
  )
}
